import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import List from './components/List';

interface IState {
	people: {
		name: string 
		age: number 
		url: string 
		note?: string
	}[]
}


function App() {

	const [guests, setGuests] = useState<IState["people"]>([]); 
  return (
    <div className="App">
			<h1>People Invited To Our Party </h1>
			<List guests={guests}/>
    </div>
  );
}

export default App;
